import LoginForm from "./LoginForm";
import styles from "./LoginForm.module.scss";

function Login() {
  return (
    <div className={styles.container}>
      <h1>Login</h1>
      <LoginForm />
      <p>Dont have an account login here.</p>
    </div>
  );
}

export default Login;
